    public oracle.jbo.domain.Number getPendQty() {
        
        if(this.getCheckRowStatus()==0){
            return (oracle.jbo.domain.Number) getAttributeInternal(PENDQTY);
        }
        
        
        oracle.jbo.domain.Number value=StaticValue.NUMBER_ZERO;
        ((SubContractReceiptAMImpl)this.getApplicationModule()).getLovScoDlvItem1().setBindCldId(EbizParams.GLBL_APP_CLD_ID());
        ((SubContractReceiptAMImpl)this.getApplicationModule()).getLovScoDlvItem1().setBindHoOrgId(EbizParams.GLBL_HO_ORG_ID());
        ((SubContractReceiptAMImpl)this.getApplicationModule()).getLovScoDlvItem1().setBindOrgId(EbizParams.GLBL_APP_USR_ORG());
        ((SubContractReceiptAMImpl)this.getApplicationModule()).getLovScoDlvItem1().setBindSlocId(EbizParams.GLBL_APP_SERV_LOC());
        ((SubContractReceiptAMImpl)this.getApplicationModule()).getLovScoDlvItem1().setBindDocId(this.getDocIdSrc());
        ((SubContractReceiptAMImpl)this.getApplicationModule()).getLovScoDlvItem1().setBindDlvNo(this.getDlvSchdlNo());
        ((SubContractReceiptAMImpl)this.getApplicationModule()).getLovScoDlvItem1().setBindType(null);
        ((SubContractReceiptAMImpl)this.getApplicationModule()).getLovScoDlvItem1().setBindItemId(this.getItmId());
        ((SubContractReceiptAMImpl)this.getApplicationModule()).getLovScoDlvItem1().executeQuery();
        
        if( ((SubContractReceiptAMImpl)this.getApplicationModule()).getLovScoDlvItem1().getRowCount()>0){
            LovScoDlvItemVORowImpl row=(LovScoDlvItemVORowImpl)((SubContractReceiptAMImpl)this.getApplicationModule()).getLovScoDlvItem1().first();    
            value=row.getBalQty().subtract(row.getTmpBalQty()==null?StaticValue.NUMBER_ZERO:row.getTmpBalQty()).add(this.getRcptQty());
        }else{
            System.out.println("Row count is zero");
        }
        
        return value;
    }

